                                }
                                fg.AppendLine("]");
                            }
                        }
                    }
                    fg.AppendLine("]");
                }
                fg.AppendItem(PNAM, "PNAM");
                fg.AppendItem(ActivateTextOverride, "ActivateTextOverride");
                fg.AppendItem(FNAM, "FNAM");
                fg.AppendItem(Ingredient, "Ingredient");
                fg.AppendItem(HarvestSound, "HarvestSound");
